// src/components/HistoryPage.js
import React, { useEffect, useState } from 'react';
import { auth } from '.../firebaseConfig';  // För att importera Firebase auth-konfiguration

const HistoryPage = () => {
  const [conversations, setConversations] = useState([]);

  useEffect(() => {
    const fetchConversations = async () => {
      const { data, error } = await supabase
        .from('conversations')  // Antag att du har en tabell för konversationer
        .select('*')
        .order('created_at', { ascending: false });

      if (error) {
        console.log('Error fetching conversations:', error);
      } else {
        setConversations(data);
      }
    };

    fetchConversations();
  }, []);

  return (
    <div>
      <h2>Historik</h2>
      <ul>
        {conversations.map((conversation) => (
          <li key={conversation.id}>
            <p>{conversation.title}</p>
            <p>{conversation.created_at}</p>
            {/* Här kan du lägga till en länk eller knapp för att spela upp ljudfilen */}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default HistoryPage;
